import { Link } from "react-router-dom";
import React, { useState } from 'react';



const Login = (props) => {

    const [username, setUsername] = useState();
    const [password, setPassword] = useState();

    const handleSubmit = (e, username, pass) => {
        e.preventDefault();
        console.log(username);

        // props.onSubmit({
        //     username: username,
        //     password: password
        // });
        // setUsername('');
        // setPassword('');



    };

    return (
        <section className="ftco-section">
            <div className="container mb-5">
                <div className="row justify-content-center">
                    <div className="col-md-6 col-lg-5">
                        <div className="login-wrap p-4 p-md-5">
                            <div className="icon d-flex align-items-center justify-content-center">
                                <span className="fa fa-user-o"></span>
                            </div>
                            <h3 className="text-center mb-4">Have an account?</h3>
                            <form onSubmit={handleSubmit} className="login-form">
                                <div className="form-group">
                                    <input
                                        name="username"
                                        type="text"
                                        className="form-control rounded-left"
                                        placeholder="Username"
                                        value={username}
                                        required
                                    />
                                </div>
                                <div className="form-group d-flex">
                                    <input
                                        name="password"
                                        type="password"
                                        className="form-control rounded-left"
                                        placeholder="Password"
                                        value={password}
                                        required />
                                </div>
                                <div className="form-group">
                                    <button onClick={handleSubmit(username, password)} type="submit" className="btn btn-primary btn-block rounded submit p-3 px-5">Get
                                        Started</button>
                                </div>
                            </form>
                        </div>
                    </div>
                </div>
            </div>

            <div className="text-center">
                <p className='text-white'>Dont have an account ? <Link to="/signup" className="text-white">Click here to SignUp!</Link></p>
            </div>
        </section>
    );

};


export default Login;
